import React from 'react';
import Logo from '../../images/Logo.png';
import { useTranslation } from 'react-i18next';
import '../../App.css';
import { BrowserRouter as Router, Route } from "react-router-dom";
import Terms from '../Legal/Terms';
import Privacy from '../Legal/PrivacyPolicy';



const Footer = () => {
    const { t } = useTranslation();

    return(
        <div className='footerContainer'>

            <div className='footerlogo'>
            <img src={Logo}  alt='Safety check circle privacy thumbnail'/>
            </div>

            <div className="footerlinks">
                <a href="mailto:iinfo@safecircleapp.com">info@safecircleapp.com</a>
                <Router> 
                    <Route exact path="/components/Legal/PrivacyPolicy" component={Terms} /> 
                    <Route exact path="/components/Legal/Terms" component={Privacy} />
                </Router>

            </div>

        </div>
    )
}

export default Footer;
